  render() {
    var namelist = ["ALL", "House", "Game", "Pet", "Other"];
    return (
      <div>
        <div>
          <p className="text-center mt-3">List EditContent</p>
          <div className="d-flex justify-content-between ">
            {namelist.map((value, index) => {
              return (
